import './App.css';
import Navbar from './Component/Navbar'; 
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Home from './Pages/Home'

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <Switch>
          <Route path='/' exact component={Home}/>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
